import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom'; // Updated import
import "./Dashboard.css";
import Sidebar from "../Sidebar/Sidebar";
import MenuIcon from '@mui/icons-material/Menu';
import UserIcon from '@mui/icons-material/AccountCircle'; // Assuming you're using Material-UI icons
import LogoImage from "../Assets/logo-white.png";

const Dashboard = () => {
  const [sidebarOpen, setSidebarOpen] = useState(false);
  const navigate = useNavigate(); // Updated for react-router-dom v6

  const navigateToProfile = () => {
    navigate('/user-profile'); // Updated navigation method
  }

  return (
    <div className="Dashboard">
      <nav className="navbar">
        <button className="menu-btn" onClick={() => setSidebarOpen(!sidebarOpen)}>
          <MenuIcon />
        </button>
        <img src={LogoImage} alt="Logo" className="logo" />
        <button className="profile-btn" onClick={navigateToProfile}>
          <UserIcon />
        </button>
      </nav>
      <Sidebar isOpen={sidebarOpen} />
      <main className={`main-content ${sidebarOpen ? "shifted" : ""}`}>
        {/* Your main app content */}
      </main>
    </div>
  );
};

export default Dashboard;
